function ListQuizItem() {
    return (
        <div className="col">
            <div className="card">
                <img src={php} className="card-img-top" alt="..." />
                <div className="card-body">
                    <h5 className="card-title text-center">React JS</h5>
                    <p className="card-text">Bài thi gồm 40 câu, thời gian 50 phút</p>
                </div>
            </div>
        </div>
    )
}

export default ListQuizItem;
